import React from "react";
import "./popup-stylelist.css"

const PopupPassword = (props) => {
    return (
        <div className="popup-box">
            <div className="box">
                <span className="close-icon" onClick={props.handleClose}>x</span>
                {props.content}
            </div>
        </div>
    );
}

export default PopupPassword;
